INSERT INTO `2018_employe_event` VALUES (158, 'Fadhila Ovi Rahmawati', NULL, 'P', 'HRGA', 'Head Office              ', '73091801', '0', NULL, NULL, NULL, 68, 'Selalu bisa diandalkan dan ga pernah komplen, meski terkadang HPnya susah banget dihubungin wkwkwkwkwk', '20181123030415', 78, 'Selalu membantu saat dibutuhkan, hanya saja dalam hal pelayanan sebagai Front Liner masih belum optimal tapi orangnya mau belajar untuk menjadi lebih baik. ', '20181123030344', 'Yes', '', '4', 'yes', '4', '3', '4', '4', '5', '3', '4', '5', '5', '5', 'Employee Gathering', 'Yes', '9', 'Panitia dibuka berdasarkan open recruitment sehingga semua orang berkesempatan untuk menjadi panitia dan mengetahui bagaimana cara kerja sebuah organisasi. \r\nKualitas hadiah untuk tahun depan seharusnya bisa diganti menjadi lebih baik namun mekanismenya sudah sangat bagus dengan memanfaatkan teknologi.\r\nDan seneng banget Pak Neeraj, Pak Adit, Bu Dani bisa hadir dan ikut meramaikan tapi sayang banget Pak Ramadahan ga bisa ikut semoga tahun depan Beliau bisa ikutan.\r\nDilihat dari keseruan Employee Gathering tahun ini, seharusnya tahun depan Gathering harus bisa lebih seru dan lebih baik!');
